import React from 'react';
import {
  Link,
  useParams,
} from "react-router-dom";


const Sidebar = () => {
  const {page} = useParams();
  document.title = (page ? toPagename(page) + " — " : "") + "Amani Rune Maina-Kilaas";
  return (
    <div id="menu-div">
      <h1>Amani Maina-Kilaas</h1>
      <Link to="/" className={page === undefined ? "active-page" : ""}>about</Link>
      <Link to="/" className={page === "research" ? "active-page" : ""}>research</Link>
      <Link to="/" className={page === "cv" ? "active-page" : ""}>cv</Link>
      <Link to="/" className={page === "misc" ? "active-page" : ""}>misc</Link>
    </div>
  );
}

export default Sidebar;
